import styled from "styled-components";

export const NavContainer = styled.div`
  background-color: grey;
  position: fixed;
  bottom: 0;
  width: 100%;
  height: 15%;
`;



const Nav = () => {
  return (
    <NavContainer>
      네비게이션
    </NavContainer>
  );
};

export default Nav;
